import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate the first "Add to Cart" button using a user-facing role selector.
    const firstAddToCartButton = page.getByRole('button', { name: 'Add to Cart' }).first();

    // Wait for the button to be visible, which indicates the products have been loaded by the script.
    await firstAddToCartButton.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot before clicking the button
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_click.png'));

    // Click the "Add to Cart" button for the first product.
    await firstAddToCartButton.click();

    // Wait for the success notification to appear, which confirms the action.
    const notification = await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take a screenshot showing the result of the action.
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_product_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_product_added.png'));

    // Extract data to verify the task was completed successfully.
    const notificationText = await notification.textContent();
    const cartText = await page.locator('div.cart').textContent();

    return {
      success: true,
      action: "Clicked 'Add to Cart' for the first product and verified the success notification.",
      extractedData: {
        notificationText: notificationText.trim(),
        cartText: cartText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add the first product to the cart.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
